(function(){"use strict";var sel=function(a,b){if(!b){b=document};return b.querySelector(a)};var all=function(a,b){var t=[];if(!b){b=document};b.querySelectorAll(a).forEach(function(e){t.push(e)});return t};var addEvt=function(a,b,c){if(Array.isArray(a)||typeof a==='string'){if(!Array.isArray(a)){a=all(a)};a.forEach(function(e){e.addEventListener(b,c)})}else{a.addEventListener(b,c)}};var loaded=function(a){addEvt(document,'DOMContentLoaded',a)};window.sel=sel;window.all=all;window.addEvt=addEvt;window.loaded=loaded}())